//import React, { useState, useEffect } from 'react';
import React, { useState } from 'react';
//import React from 'react';
import Sidebar from '../layout/Sidebar';
import Barra from '../layout/Barra';
import Menu from '../layout/Menu';
import MiEquipo from '../tareas/MiEquipo';
import Jugadores from '../tareas/Jugadores';
import Plantel from '../tareas/Plantel';
import Partidos from '../tareas/Partidos';
import Formacion from '../tareas/Formacion';
import Entrenamientos from '../tareas/Entrenamientos';
import Reportes from '../tareas/Reportes';
import {mostrarMensaje, numeroMenu} from '../unused/Funciones';

const Equipos = ({nombreMen}) => {

    //State para el equipo
    const [equipo, guardarEquipo] = useState({
        nombre: 1
    });

    //Extraer nombre del state equipo
    const {nombre} = equipo;

    console.log('mostrarNombre: ' + nombre);
    console.log('mostrarMen: ' + nombreMen);
    mostrarMensaje();
    const num = numeroMenu;
    console.log(num);

    //useEffect (() => {
    //    
    //}, []);
    
    return (
        <div className="contenedor-app">
            <Sidebar />
            <div className="seccion-principal">
                <Barra />
                <Menu />
                <main>
                    <div className="contenedor-tareas">
                        {
                            (()=> {
                                switch (nombre) {
                                    case 1: return <MiEquipo />;
                                    case 2: return <Jugadores />;
                                    case 3: return <Plantel />;
                                    case 4: return <Partidos />;
                                    case 5: return <Formacion />;
                                    case 6: return <Entrenamientos />;
                                    case 7: return <Reportes />;
                                }
                            })()
                        }
                    </div>
                </main>
            </div>
        </div>
    );
}
export default Equipos;
